import React, { useEffect, useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLinkedin, faGithub, faHackerrank, faGripfire } from '@fortawesome/free-brands-svg-icons';

import './CSS/Headers.css'
const Header = () => {
  const [links, setLinks] = useState([]);
  const [projects, setProjects] = useState();
  
  
  useEffect(() => {
    setLinks([
      {
        "name": 'linkedin',
        'url': "https://www.linkedin.com/in/hdevavan/",
        'icon': faLinkedin
      },
      {
        "name": 'github',
        'url': "https://github.com/Devavanshi-Harsh",
        'icon': faGithub
      },
      {
        "name": 'hackerrank',
        'url': "https://www.hackerrank.com/HarshDevavanshi",
        'icon': faHackerrank
      },
    ])
    setProjects(["https://devavanshi-harsh.github.io/MongataGalloStore/homepage.html"])
  }, [])

  return (
    <div className='container'>
      <div className='icons'>
        {
          links.map((item, index) => {
            return (
              <a href={item.url} target='.blank' rel="noopener noreferrer" key={index} >{item.icon && <FontAwesomeIcon icon={item.icon} className='icon' />}</a>
            )
          })
        }
      </div>
      <div className='contacts'>
        <a href={projects} target='.blank' rel="noopener noreferrer"  >Projects</a>
        <a>Contact Me</a>
      </div>
    </div>
  );
};

export default Header;
